import React from "react";

function Home() {

    const handleClick = () => {
        console.log("hello")
    }

    const handleClickAgain = (name) => {
        console.log('hello ' + name)
    }

    return(
        <div className="home">
        <h2>Home</h2>
        <button onClick={handleClick}> click me</button>
        <button onClick={() => handleClickAgain('m')}> click again</button>
        <p> this is the description</p>
        </div>
    )
}

export default Home;
